import { useEffect, useState } from 'react'

const Index = () => {
  const [devices, setDevicces] = useState([])
  useEffect(() => {
    fetch("http:127.0.0.1:8080/devices")
    .then(res => {
      return res.json()
    })
    .then(json => {
      console.log(json)
    })
  }, [])
  return (
    <div className="flex">
      Devive list
    </div>
  )
}

export default index
